"   <p class=\"headingAnchor\" id=\"H23736716\">",
"    <span class=\"h1\">",
"     SUMMARY",
"    </span>",
"    &nbsp;&mdash;&nbsp;Stomatocytosis (hydrocytosis) is defined by the appearance on the peripheral smear of red blood cells (RBCs) with a mouth-shaped area of central pallor (",
"    <a class=\"graphic graphic_picture graphicRef75535 \" href=\"mobipreview.htm?8/51/9015\">",
"     picture 1",
"    </a>",
"    ).",
"   </p>",
"   <p>",
"    <ul class=\"bullet-block\">",
"     <li>",
"      Hereditary stomatocytosis is an autosomal dominant disorder characterized by increased permeability of the RBC membrane to sodium and potassium. (See",
"      <a class=\"local\" href=\"#H2\">",
"       'Hereditary stomatocytosis'",
"      </a>",
"      above and",
"      <a class=\"local\" href=\"#H3\">",
"       'Pathogenesis'",
"      </a>",
"      above.)",
"     </li>",
"    </ul>",
"   </p>",
"   <p>",
"    <ul class=\"hyphen-block\">",
"     <li>",
"      Subjects present with hemolytic anemia in childhood or adolescence. Occasional patients may present with perinatal ascites, or acute vasoocclusive crises. (See",
"      <a class=\"local\" href=\"#H4\">",
"       'Clinical presentation'",
"      </a>",
"      above.)",
"     </li>",
"     <li>",
"      Hemolytic anemia in a young person along with stomatocytes suggest this diagnosis. RBCs are macrocytic with a reduced mean corpuscular hemoglobin concentration. (See",
"      <a class=\"local\" href=\"#H5\">",
"       'Diagnosis'",
"      </a>",
"      above.)",
"     </li>",
"     <li>",
"      The disorder needs to be distinguished from cryohydrocytosis (hemolysis at 4&deg;C), familial pseudohyperkalemia (increased passive potassium leak at low temperatures), Rh-null disease (absence of Rh antigens on the RBC surface), and Tangier disease (very low levels of HDL), all of which have stomatocytes. (See",
"      <a class=\"local\" href=\"#H6\">",
"       'Differential diagnosis'",
"      </a>",
"      above and",
"      <a class=\"local\" href=\"#H10\">",
"       'Other genetic causes of stomatocytosis'",
"      </a>",
"      above.)",
"     </li>",
"     <li>",
"      Splenectomy may improve the hemolytic anemia but is associated with thrombocytosis and an increased risk of potentially severe thrombotic complications. (See",
"      <a class=\"local\" href=\"#H9\">",
"       'Treatment'",
"      </a>",
"      above.)",
"     </li>",
"    </ul>",
"   </p>",
"   <p>",
"    <ul class=\"bullet-block\">",
"     <li>",
"      Stomatocytosis can be acquired in acute alcohol intoxication or chronic liver disease. Intercalation of certain drugs (eg,",
"      <a class=\"drug drug_general\" href=\"mobipreview.htm?1/29/1498?source=see_link\">",
"       vincristine",
"      </a>",
"      ,",
"      <a class=\"drug drug_general\" href=\"mobipreview.htm?4/3/4152?source=see_link\">",
"       vinblastine",
"      </a>",
"      ,",
"      <a class=\"drug drug_general\" href=\"mobipreview.htm?29/38/30312?source=see_link\">",
"       chlorpromazine",
"      </a>",
"      ) into the inner-half of the lipid bilayer may also induce stomatocyte formation. (See",
"      <a class=\"local\" href=\"#H13\">",
"       'Acquired stomatocytosis'",
"      </a>",
"      above.)",
"     </li>",
"    </ul>",
"   </p>",
